import React from "react";

const FirstPage = ({ props }) => {
  return (
    <>
      <p>あああ</p>
      <button onClick={props.handleClick} disabled={props.isPending}>
        セカンドページへ
      </button>
    </>
  );
};

export default FirstPage;
